import React, { Component } from "react";
import Switch from "react-switch";

export default class SwitchExample extends Component {
  constructor() {
    super();
    this.state = { 
        forex: false,
        stocks: false,
        crypto: false 
    };
    this.handleChange = this.handleChange.bind(this);
  }

  handleChange(checked) {
    this.setState({ checked });
  }

  render() {
    return (
      <label>
        <span>Switch with default style</span>
        <div>
            Forex
            <Switch onChange={this.handleChange} checked={this.state.forex} />
        </div>
        <div>
            Stocks
            <Switch onChange={this.handleChange} checked={this.state.stocks} />
        </div>
        <div>
            Crpyto
            <Switch onChange={this.handleChange} checked={this.state.crpyto} />
        </div>
      </label>
    );
  }
}
